const mongoConnect = require("../db/mongo");
const { ObjectId } = require('mongodb');


const groupBy = (items, key) => items.reduce(
  (result, item) => ({
    ...result,
    [item[key]]: [
      ...(result[item[key]] || []),
      item,
    ],
  }), 
  {},
);

const insertFreightTable = async () => {
  let db = await mongoConnect();
  let freightColl = db.collection('freight');

  let grouped = groupBy(data, 'name');

  for (let prop in grouped) {
    let { name, zipStart, zipEnd, estimated, service } = grouped[prop][0];
    await freightColl.updateOne(
      { name },
      { 
        $set: {
          sellerId: new ObjectId('60c8d8166d68ee0822bfcf71'),
          name, 
          service,
          zipStart, 
          zipEnd, 
          estimated, 
          values: grouped[prop].map(m => {
            return {weight: m.weight, price: m.price}
          }) 
        }
      },
      {
        upsert: true
      }
    );
  }

}

insertFreightTable();

